import React from 'react';

class Contact extends React.Component {
  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="p-5 w-100" style={{height: 'fit-content', backgroundColor: '#CAF0F8', color: '#03045E'}}>
         <h1>Contact</h1>
         <form class="container d-flex flex-column container-fluid text-start rounded-4 p-3" style={{border:'2px solid #03045E'}}>
            <label for="email" className="d-flex flex-column">Email</label> 
            <input id="email" type="email" placeHolder="Enter your email" className="" />
            <label for="name" className=" flex-column">Name</label>
            <input id="email" type="text" max="50" placeHolder="Enter your name" />
            <button type="submit" className="btn btn-primary block m-3">Contact</button>
         </form>
      </div>
    );
  }
}

export { Contact }
